import * as types from './../constant/ActionTypes';
let initialDefault = []


const products = (state = initialDefault,action) => {
let {products} = action;
        switch(action.type){
        case types.FETCH_PRODUCTS:
            state = action.products;
            console.log(products);
            return [...state]; 
            default:
                return [...state]
        }
}
export default products;
